import React from 'react'
import './Movies.css'
import MovieCard from './MovieCard'
import Favorite from './Favorite'



const MovieList =  ({movies}) => {



    if(movies.length === 0){
        return(
            <h3 style={{textAlign:'center'}}>No results</h3>
        )
    }else{

  const renderedList = movies
        .filter(movie => movie.poster_path !== null)
        .map((movie,key) => {
            return(
                <div key={key} style={{display:'inline-flex', flexDirection:'column', textAlign:'center'}}  >
                <MovieCard image={`https://image.tmdb.org/t/p/w185${movie.poster_path}`} id={movie.id} title={movie.title}/> 
                <Favorite />
            </div>

            )
        })




    return (
        <div className="movie-rendered-list">
            {renderedList}
        </div>  
    )
}
}

export default MovieList
